import React from 'react';
import Grid from '@material-ui/core/Grid';
import { makeStyles, withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';

const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },
    content: {
        border: '1px solid #777' ,
        padding: '15px 25px',
    },
}));

const TestBtn = withStyles({
    root: {
        marginBottom: '15px',
        padding: '8px 15px',
        lineHeight: 1.5,
        '&:hover': {
            boxShadow: 'none',
        },
        '&:active': {
            boxShadow: 'none',
        },
    }
})(Button);

export default function BeneInfo () {
    const classes = useStyles();
    return (
        <React.Fragment>
            <div className="container">
                <div className={classes.root}>
                    <Grid container spacing={3}>
                        <Grid item xs={12} md={10}>
                            <div className={classes.content}>
                                <code>"transfer_info"</code>
                            </div>
                        </Grid>
                        <Grid Grid item xs={12} md={2}>
                            <TestBtn variant="contained" className="btn btn-primary">
                                Verify
                            </TestBtn>
                            <TestBtn variant="outlined" className="btn" disabled>
                                Decrypt
                            </TestBtn>
                        </Grid>
                        <div>
                        <Button variant="contained" color="primary">
        Primary
      </Button>
      <Button variant="contained" color="secondary">
        Secondary
      </Button>
                        </div>
                    </Grid>
                </div>
            </div>
        </React.Fragment>
    );
}
